    false,nt"url": null,nt"notes": "NODC Accession 0109930 includes biological,
    chemical, meteorological, physical and underway - surface data collected from NOAA
    Ship RONALD H. BROWN in the North Atlantic Ocean, North Pacific Ocean, Rio de la
    Plata, South Atlantic Ocean and South Pacific Ocean from 2008-01-22 to 2009-01-11
    and retrieved during cruise RB-08-01, RB-08-02, RB-08-03, RB-08-06A, RB-08-06B and
    RB-08-07.. These data include AIR TEMPERATURE, BAROMETRIC PRESSURE, CARBON DIOXIDE
    - AIR, CARBON DIOXIDE - PARTIAL PRESSURE - DIFFERENCE, FLUORESCENCE, Partial pressure
    (or fugacity) of carbon dioxide, SALINITY, SEA SURFACE TEMPERATURE, WIND DIRECTION
    and WIND SPEED. The instruments used to collect these data include Barometric pressure
    sensor, Carbon dioxide (CO2) gas analyzer, Shower head chamber equilibrator for
    autonomous carbon dioxide (CO2) measurement and thermosalinographs. These data were
    collected by Rik Wanninkhof of US DOC; NOAA; OAR; Atlantic Oceanographic and Meteorological
    Laboratory as part of the R/V Ronald Brown 2008 Underway Data data set.nnThe Global
